import { unserializePHP } from '../src/unserializePHP'
import { decode64, stringify } from '../src/utils'


// MARK: Parsing tests

test('Parse null', () => {
    expect(unserializePHP('N;')).toBe(null);
});

test('Parse boolean', () => {
    expect(unserializePHP('b:0;')).toBe(false);
});

test('Parse string', () => {
    expect(unserializePHP('s:3:"abc";')).toBe('abc');
});

test('Parse positive int', () => {
    expect(unserializePHP('i:123;')).toBe(123);
});

test('Parse negative int', () => {
    expect(unserializePHP('i:-123;')).toBe(-123);
});

test('Parse decimal', () => {
    expect(unserializePHP('d:123.45;')).toBe(123.45);
});

test('Parse enum', () => {
    expect(unserializePHP('E:17:"Weekdays:Saturday";')).toBe('Weekdays:Saturday');
});

test('Parse indexed array', () => {
    expect(unserializePHP('a:3:{i:0;i:1;i:1;i:2;i:2;i:3;}')).toEqual([1, 2, 3]);
});

test('Parse associative array', () => {
    expect(unserializePHP('a:3:{i:0;i:1;s:1:"a";i:2;i:2;i:3;}')).toEqual({ '0': 1, 'a': 2, '2': 3 });
});

test('Parse simple object', () => {
    expect(unserializePHP('O:7:"MyClass":2:{s:3:"foo";s:3:"bar";s:3:"baz";i:123;}')).toEqual({ _type: 'MyClass', 'foo': 'bar', 'baz': 123 });
});

test('Parse another simple object', () => {
    expect(unserializePHP('O:2:"My":2:{s:4:"Myxs";N;s:8:"Mynested";O:6:"Nested":2:{s:3:"foo";s:12:"s:666:"test"";s:3:"baz";i:123;}}')).toEqual({ _type: 'My', 'Myxs': null, 'Mynested': { _type: 'Nested', foo: 's:666:"test"', baz: 123 } });
});

test('Parse a resursive object', () => {
    const obj = { _type: 'My', a: 10 }
    obj.b = obj
    expect(unserializePHP('O:2:"My":1:{s:1:"a";i:10;s:1:"b";r:1;}}')).toEqual(obj);
});

test('Parse a huge object: Mezzio service manager', () => {
    const serialized = ""

    const expected = decode64('')

    expect(stringify(unserializePHP(serialized, { decode: 'base64' }))).toBe(expected)
})


// MARK: Helper tests
test('Decode base64', () => {
    expect(decode64('Tzo3OiJNeUNsYXNzIjoyOntzOjM6ImZvbyI7czozOiJiYXIiO3M6MzoiYmF6IjtpOjEyMzt9='))
        .toBe('O:7:"MyClass":2:{s:3:"foo";s:3:"bar";s:3:"baz";i:123;}')
})